[fan_generic FANDUCTS]
##	CPAP Print Cooling Fan - PF8
pin: PF8
max_power: 1
cycle_time: 0.02
kick_start_time: 0.1
hardware_pwm: false
shutdown_speed: 0
off_below: 0.01

[fan_generic RSCS]
##  RSCS Fans - In FAN1 Positon
pin: PA1
max_power: 1.0
#shutdown_speed: 0
kick_start_time: 0.1
off_below: 0.01
cycle_time: 0.001

[gcode_macro M106]
gcode:
    # M118 {params.P}
      {% if (params.P is defined) and ((params.P|int) == 2|int) %} # P = 2
        {% if params.S is defined %} # P - S
          M118 SET_FAN_SPEED FAN=RSCS SPEED={(params.S|int / 255)|round(2)}
          SET_FAN_SPEED FAN=RSCS SPEED={(params.S|int / 255)|round(2)}
        {% else %}  # P != 2
          M118 SET_FAN_SPEED FAN=RSCS SPEED=255
          SET_FAN_SPEED FAN=RSCS SPEED=255
        {% endif %}            
      {% else %}
        {% if params.S is defined %} # !P - S
          M118 SET_FAN_SPEED FAN=FANDUCTS SPEED={(params.S|int / 255)|round(2)}
          SET_FAN_SPEED FAN=FANDUCTS SPEED={(params.S|int / 255)|round(2)}
        {% else %}  # !P - !S
         M118 SET_FAN_SPEED FAN=FANDUCTS SPEED=255      
        SET_FAN_SPEED FAN=FANDUCTS SPEED=255        
        {% endif %}
      {% endif %}

[heater_fan hotend_fan]
##	Hotend Fan - FAN0 Connector
## in case of a watercooler that is 24V use a Heater Pin like PF7 Heat3 for a larger mosfet that can handle more amps.
pin: PA0
max_power: 1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0

[fan_generic Exhaust_fan]
##  exhaust fan - In FAN4
pin: PA15
max_power: 1
shutdown_speed: 0
kick_start_time: 0.5
off_below: 0.01



